SAMPLE_LABELS = ['Sample Visa', 'Sample Passport']

def get_sample(label: str) -> tuple[bytes, str] | None:
  entry = SAMPLES.get(label)
  if not entry:
    return None
  data = base64.b64decode(''.join(entry['b64']))
  return data, entry['filename']
